import bufLogo from './logos/bufLogo.png';


import cinLogo from './logos/cinLogo.png';
import cleLogo from './logos/cleLogo.png';
import cltLogo from './logos/cltLogo.png';
import crdLogo from './logos/crdLogo.png';

import denLogo from './logos/denLogo.png';

import htxLogo from './logos/htxLogo.png';
import jaxLogo from './logos/jaxLogo.png';
import kanLogo from './logos/kanLogo.png';
import miaLogo from './logos/miaLogo.png';


import nweLogo from './logos/nweLogo.png';

import nyjLogo from './logos/nyjLogo.png';
import otiLogo from './logos/otiLogo.png';
import phiLogo from './logos/phiLogo.png';
import pitLogo from './logos/pitLogo.png';
import raiLogo from './logos/raiLogo.png';
import ramLogo from './logos/ramLogo.png';
import ravLogo from './logos/ravLogo.png';
import sdgLogo from './logos/sdgLogo.png';
import seaLogo from './logos/seaLogo.png';
import sfoLogo from './logos/sfoLogo.png';

import wasLogo from './logos/wasLogo.png';
import './HomePage.css';

import NFCNorth from "./pages/NFC/North/teams"
import NFCSouth from "./pages/NFC/South/teams"
import NFCEast from "./pages/NFC/East/teams"







function sfoButton() {
  window.location.replace("/sfo");
}
function crdButton() {
  window.location.replace("/crd");
}
function ramButton() {
  window.location.replace("/ram");
}
function seaButton() {
  window.location.replace("/sea");
}

function NFCWest() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>WEST</th>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={sfoButton}>
            <img class="logos" src={sfoLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={crdButton}>
            <img class="logos" src={crdLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={ramButton}>
            <img class="logos" src={ramLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={seaButton}>
            <img class="logos" src={seaLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
    </table>
    </div>
  );
}


function cleButton() {
  window.location.replace("/cle");
}
function ravButton() {
  window.location.replace("/rav");
}
function pitButton() {
  window.location.replace("/pit");
}
function cinButton() {
  window.location.replace("/cin");
}

function AFCNorth() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>NORTH</th>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={cleButton}>
            <img class="logos" src={cleLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={ravButton}>
            <img class="logos" src={ravLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={pitButton}>
            <img class="logos" src={pitLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={cinButton}>
            <img class="logos" src={cinLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
    </table>
    </div>
  );
}

function htxButton() {
  window.location.replace("/htx");
}
function cltButton() {
  window.location.replace("/clt");
}
function otiButton() {
  window.location.replace("/oti");
}
function jaxButton() {
  window.location.replace("/jax");
}

function AFCSouth() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>SOUTH</th>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={htxButton}>
            <img class="logos" src={htxLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={cltButton}>
            <img class="logos" src={cltLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={otiButton}>
            <img class="logos" src={otiLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={jaxButton}>
            <img class="logos" src={jaxLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
    </table>
    </div>
  );
}

function bufButton() {
  window.location.replace("/buf");
}
function nweButton() {
  window.location.replace("/nwe");
}
function nyjButton() {
  window.location.replace("/nyj");
}
function miaButton() {
  window.location.replace("/mia");
}

function AFCEast() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>EAST</th>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={bufButton}>
            <img class="logos" src={bufLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={nweButton}>
            <img class="logos" src={nweLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={nyjButton}>
            <img class="logos" src={nyjLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={miaButton}>
            <img class="logos" src={miaLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
    </table>
    </div>
  );
}

function raiButton() {
  window.location.replace("/rai");
}
function denButton() {
  window.location.replace("/den");
}
function kanButton() {
  window.location.replace("/kan");
}
function sdgButton() {
  window.location.replace("/sdg");
}

function AFCWest() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>WEST</th>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={raiButton}>
            <img class="logos" src={raiLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={denButton}>
            <img class="logos" src={denLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
          <button class="button" onClick={kanButton}>
            <img class="logos" src={kanLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
      <tr>
        <td>
           <button class="button" onClick={sdgButton}>
            <img class="logos" src={sdgLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
    </table>
    </div>
  );
}


function HomePage() {
  return (
    <div>
      <table id="conf">
        <tr>
          <td>
            <table class="confTable">
              <tr>
                <th colspan="4">NFC</th>
              </tr>
              <tr>
                <td> <NFCNorth/> </td>
                <td> <NFCSouth/> </td>
                <td> <NFCEast/> </td>
                <td> <NFCWest/> </td>
              </tr>
            </table>
          </td>
          <td>
            <table class="confTable">
              <tr>
                <th colspan="4">AFC</th>
              </tr>
              <tr>
                <td> <AFCNorth/> </td>
                <td> <AFCSouth/> </td>
                <td> <AFCEast/> </td>
                <td> <AFCWest/> </td>
              </tr>
            </table>
          </td>
        </tr>
      </table>
      <h4 id="Footer">
        All right reserved ... Some other important legal documentation can be found at the link below. <br></br>
        <div id="link">
          link.site.0rg
        </div>
      </h4>
    </div>

  );
}

export default HomePage;
